地图功能包含（具体参考下文的使用文档）：

在指定的页面上创建指定大小的地图 View
在地图的 View 里绘制气泡、折线、Marker、文字、圆形，控件等
响应地图 View 上各种控件和绘制的交互，如点击事件、经纬度变化事件等等
响应地图 View 的大小，经纬度，绘制元素的位置和大小更新等
删除地图组件
移动地图上的 Marker 图标到指定的经纬度
