获取地图显示框内的边框四个点经纬度
获取地图当前中心的经纬度
打开一个新页面从中选择一个地点（返回经纬度）
进行步行导航和 AR 导航
其他细节等


推荐使用百度地图的 SDK 进行接入，有详细的实现代码，接入成本较低；其他地图SDK需要重新实现下文 接口设计 中的接口。

