  // middleWares提供对所有native能力的统一前置处理,这里可以方便的处理没实现的最小集
  middleWares: [
      context => next => async scheme => {
          switch (scheme.action) {
              case 'chooseInvoiceTitle':
              case 'chooseAddress':
              case 'requestPolymerPayment':
                  context.event.send(
                      'inspector.loggerToConsole',
                      {
                          level: 'error',
                          value: `在demo宿主中,不支持${scheme.action}`
                      }
                  );
                  break;
              default:
                  return next(scheme);
          }
      }
  ],

